import { createAsyncThunk, createSlice } from '@reduxjs/toolkit';
import { activeLinks, createUser } from '../services/admin.service';

const initialState = {

};

export const currentLinksAsync = createAsyncThunk(
    'customer/fetchCurrentOrders',
    async () => {
        const response = await activeLinks();
        return response.data;
    }
);

export const pastOrderAsync = createAsyncThunk(
    'customer/fetchPastOrders',
    async () => {
        const response = await createUser();
        return response.data;
    }
);

export const adminSlice = createSlice({
    name: 'admin',
    initialState,
    reducers: {
    },
    extraReducers: (builder) => {
        builder
            .addCase(currentLinksAsync.fulfilled, (state, action) => {
                console.log('loaded current orders')
                state.currentOrders = action.payload;
            })
            .addCase(pastOrderAsync.fulfilled, (state, action) => {
                console.log('loaded past orders')
                state.pastOrders = action.payload;
            })
    },
});

export const {} = adminSlice.actions;

export const selectCurrentOrders = (state) => state.admin.currentOrders;
export const selectPastOrders = (state) => state.admin.pastOrders;



export default adminSlice.reducer;
